import { useEffect, useState } from 'react';

function LeaderBoard() {
    const[users, setUsers] = useState([]);

    const fetchData = () => {
        fetch("http://127.0.0.1:8000/").then(response => {return response.json()}).then(data => { setUsers(data) });
    }

    useEffect(() => {
        fetchData()
    }, []);


    
    
    return (
        <div>
            <h2>Leaderboard</h2>
            <br></br>
            
        </div>
    )
}

export default LeaderBoard
